import React from "react";

function Header() {
  const headerStyle = {
    backgroundColor: "violet",
    color: "white",
    padding: "20px",
    textAlign: "center",
    borderRadius: "8px",
  };

  return <h1 style={headerStyle}>React App</h1>;
}

export default Header;
